function: "My name is Dara and I am a teacher at the Brooklyn International High School. All of my students are recently arrived English Language Learners (ELLs).  I am lucky enough to have a Makerbot in my classroom. My students and I love to use tinkercad to make our 3-D projects. This is a design made by Serigne from West Africa. It is Elsinore Castle, the setting of William Shakespeare's play Hamlet. \r\n\r\nThe original tinkercad design file can be found here https://tinkercad.com/things/0B0SwzRRxaI\r\n\r\nFeel free to leave any comments for Serigne."
